import React from "react";

export const MainPage = () => (
    <div>
        <main className="page lanidng-page">
            <section className="portfolio-block block-intro">
                <div className="container">
                    {/*<div className="avatar" style="background-image:url(&quot;assets/img/avatars/avatar.jpg&quot;);">*/}
                    {/*</div>*/}
                    <div className="about-me">
                        <p>Hello! I am <strong>John Smith</strong>. I work as interface and front end developer. I have
                            passion for pixel perfect, minimal and easy to use interfaces.</p><a
                        className="btn btn-outline-primary" role="button" href="#">Hire me</a>
                    </div>
                </div>
            </section>
        </main>
    </div>
);
